// SimpleRoom is a basic room implementation with a forest theme
type SimpleRoom struct {
	*BaseRoom
	tileSize int
	tilesPerRow int
	forestTiles map[int]*ebiten.Image
	parallaxRenderer *engine.ParallaxRenderer
}

// NewSimpleRoom creates a new simple room with forest tiles
func NewSimpleRoom(zoneID string) *SimpleRoom {
	// Create room based on config settings
	room := &SimpleRoom{
		BaseRoom: NewBaseRoom(zoneID, engine.GameConfig.RoomWidthTiles, engine.GameConfig.RoomHeightTiles),
		tileSize: engine.GameConfig.TileSize,
		tilesPerRow: 8, // Forest tilemap has 8 tiles per row
		forestTiles: make(map[int]*ebiten.Image),
	}

	// Initialize enhanced parallax system
	room.initializeParallaxLayers()
	room.initializeForestTiles()
	room.buildRoom()
	return room
}

// initializeParallaxLayers sets up the enhanced multi-layer parallax system
func (sr *SimpleRoom) initializeParallaxLayers() {
	// Always create parallax layers - use config if available, otherwise use defaults
	layers := engine.GameConfig.ParallaxLayers
	if len(layers) == 0 {
		// Create default demo layers with different speeds and depths
		// Background layers (depth <= 0.5) and foreground layers (depth > 0.5)
		layers = []engine.ParallaxLayer{
			{
				Speed:      0.1,
				Depth:      0.05,
				Alpha:      0.3,
				Scale:      0.25,
				OffsetX:    0,
				OffsetY:    80,
				Repeatable: true,
			},
			{
				Speed:      0.3,
				Depth:      0.3,
				Alpha:      0.5,
				Scale:      0.4,
				OffsetX:    0,
				OffsetY:    40,
				Repeatable: true,
			},
			{
				Speed:      0.5,
				Depth:      0.5,
				Alpha:      0.7,
				Scale:      0.6,
				OffsetX:    0,
				OffsetY:    0,
				Repeatable: true,
			},
			{
				Speed:      1.1,
				Depth:      0.9,
				Alpha:      0.6,
				Scale:      1.2,
				OffsetX:    0,
				OffsetY:    -20,
				Repeatable: true,
			},
			{
				Speed:      1.3,
				Depth:      0.95,
				Alpha:      0.4,
				Scale:      1.5,
				OffsetX:    0,
				OffsetY:    -50,
				Repeatable: true,
			},
		}
	}
	
	// Always create the parallax renderer - no fallback mechanism
	sr.parallaxRenderer = engine.NewParallaxRenderer(
		layers,
		engine.GameConfig.EnableDepthOfField,
		engine.GameConfig.DepthBlurStrength,
	)
}

// initializeForestTiles extracts individual tiles from the forest tilemap
func (sr *SimpleRoom) initializeForestTiles() {
	if engine.GetTileSprite() == nil {
		return
	}

	// The forest tilemap has 8 tiles per row and 3 rows (24 tiles total, indices 0-23)
	for i := 0; i <= 23; i++ {
		x := (i % sr.tilesPerRow) * sr.tileSize
		y := (i / sr.tilesPerRow) * sr.tileSize
		
		// Use SubImage to extract the tile from the tilemap
		subImg := engine.GetTileSprite().SubImage(image.Rect(x, y, x+sr.tileSize, y+sr.tileSize)).(*ebiten.Image)
		sr.forestTiles[i] = subImg
	}
}

// getTileSprite returns the appropriate sprite for a tile type
func (sr *SimpleRoom) getTileSprite(tileIndex int) *ebiten.Image {
	// First try local cache for backwards compatibility
	if sprite, exists := sr.forestTiles[tileIndex]; exists {
		return sprite
	}
	
	// Try sprite manager
	sprite := engine.LoadSpriteByHex(tileIndex)
	if sprite != nil {
		return sprite
	}
	
	// Fallback to dirt if not found
	if sprite, exists := sr.forestTiles[TILE_DIRT]; exists {
		return sprite
	}
	return engine.GetTileSprite()
}

// buildRoom sets up the tile layout based on the room's tilemap dimensions
func (sr *SimpleRoom) buildRoom() {
	if engine.GetTileSprite() == nil {
		return
	}

	// For 10x10 rooms, use the predefined layout
	if sr.tileMap.Width == 10 && sr.tileMap.Height == 10 {
		// Copy the predefined layout directly
		for y := 0; y < 10; y++ {
			for x := 0; x < 10; x++ {
				sr.tileMap.Tiles[y][x] = room10x10Layout[y][x]
			}
		}
	} else {
		// For other sizes, generate walls dynamically
		for y := 0; y < sr.tileMap.Height; y++ {
			for x := 0; x < sr.tileMap.Width; x++ {
				// Walls on all edges, empty (-1) inside
				if x == 0 || x == sr.tileMap.Width-1 || y == 0 || y == sr.tileMap.Height-1 {
					sr.tileMap.Tiles[y][x] = TILE_DIRT
				} else {
					sr.tileMap.Tiles[y][x] = -1  // Empty
				}
			}
		}
	}
	
	// Simple debug: Print layout to console for easy copying
	PrintRoomLayout(sr.GetZoneID(), sr.tileMap)
}

// createPlatform creates a floating platform at the specified position
func (sr *SimpleRoom) createPlatform(x, y, width int) {
	if width < 2 {
		return
	}
	
	// Left edge
	sr.tileMap.SetTile(x, y, TILE_SINGLE_LEFT)
	
	// Middle tiles
	for i := 1; i < width-1; i++ {
		sr.tileMap.SetTile(x+i, y, TILE_SINGLE_HORIZONTAL)
	}
	
	// Right edge
	sr.tileMap.SetTile(x+width-1, y, TILE_SINGLE_RIGHT)
}

// createWall creates a vertical wall from startY to endY
func (sr *SimpleRoom) createWall(x, startY, endY int) {
	for y := startY; y <= endY; y++ {
		if y == startY {
			sr.tileMap.SetTile(x, y, TILE_SINGLE_TOP)
		} else if y == endY {
			sr.tileMap.SetTile(x, y, TILE_SINGLE_BOTTOM)
		} else {
			sr.tileMap.SetTile(x, y, TILE_SINGLE_VERTICAL)
		}
	}
}

